import React from 'react';
import { FiPlus, FiFileText, FiTarget, FiDownload } from 'react-icons/fi';

const QuickActions = () => {
    const actions = [
        { icon: <FiPlus />, label: 'Add Income', color: '#4CAF50' },
        { icon: <FiPlus />, label: 'Add Expense', color: '#F44336' },
        { icon: <FiFileText />, label: 'View Reports', color: '#2196F3' },
        { icon: <FiTarget />, label: 'Set Goal', color: '#9C27B0' },
        { icon: <FiDownload />, label: 'Export Data', color: '#FF9800' },
    ];

    return (
        <div className="quick-actions">
            <h3>Quick Actions</h3>
            <div className="actions-grid">
                {actions.map((action, index) => (
                    <button 
                        key={index} 
                        className="action-btn"
                        style={{ borderColor: action.color }}
                    >
                        <span className="action-icon" style={{ color: action.color }}>
                            {action.icon}
                        </span>
                        <span className="action-label">{action.label}</span>
                    </button>
                ))}
            </div>
        </div>
    );
};

export default QuickActions;
